contains_prompts.prompt:
When I request a response that must contain prompts, you must use the following JSON schema to return the prompts.

JSON Schema for Responses Containing Prompts

{
  "type": "object",
  "properties": {
    "name": {
      "type": "string",
      "description": "Name of the prompt plan (optional)"
    },
    "additional_context": {
      "type": "string",
      "description": "Additional context to be added to the existing context"
    },
    "selected_user_prompts_dict": {
      "type": "object",
      "description": "Dictionary of selected user prompts, where keys are prompt names and each key has a string value user_prompt and an integer value recommended word_count",
      "additionalProperties": {
        "type": "string"
      },

    "other_parameters": {
      "type": "object",
      "description": "Other parameters required by the PromptPlan class (e.g., system instructions, output settings, etc.)"
    }
  },
  "required": [
    "selected_user_prompts_dict",
    "complete_system_instructions",
  ]
}
